import React, { Component } from 'react';
import Continuar_bot  from '../components/Contiunar_bot.js'
import Logo_mpt from '../imgs/Logo_mpt.png'
class Navigation extends Component{
    render(){
        return (
          <nav>
          <h1 class= "h4"> Bienvenido/a a Mpt! </h1>      
          <p>
          <p src={Logo_mpt}/>           
          </p>
          <Continuar_bot>></Continuar_bot>

        </nav>
      
        )
    }
}

export default Navigation;
